"""Seed file to make sample data for pets db."""

from models import Pet, db
from app import db

# Create all tables
db.drop_all()
db.create_all()

# If table isn't empty, empty it
Pet.query.delete()

#Add pets
happy = Pet(
    name='Happy', 
    species='Husky', 
    photo_url='data:image/webp;base64,',
    age=2, 
    notes='Cutest husky in town')

tofu = Pet(
    name='Tofu', 
    species='French Bulldog', 
    photo_url='data:image/webp;base64,',
    age=1, 
    notes='Woof Woof')

tickles = Pet(
    name='Tickles', 
    species='Cat', 
    photo_url='data:image/webp;base64,',
    age=3, 
    notes='Meowww~~')


# Add new objects to session, so they'll persist
